import "./App.css";
import Navbar from "./components/Navbar/Navbar";
import Header from "./components/Header/Header";
import Partners from "./components/Partners/Partners";
import EquipNavbar from "./components/Equipment/EquipNavbar/NavbarEquip";

const App = () => {
    return (
        <div>
            <div className="bg">
                <Navbar />
                <Header />
            </div>
            <Partners />
            <EquipNavbar />
            <BrowserRouter>
                <Route path="/sound" render={() => <Sound />}></Route>
                <Route path="/light" render={() => <Light />}></Route>
                <Route path="/effects" render={() => <Effects />}></Route>
                <Route path="/sound" render={() => <Complect />}></Route>
            </BrowserRouter>
        </div>
    );
};

export default App;
